import react from "react";
import ReactDOM from "react-dom";
import { Contact, Header, About, Footer } from "./";

const Main = () => {
  return (
    <div className="container">
      <Header />
      <Contact />
      <About />
      <Footer />
    </div>
  );
};

export default Main;
